    question: "",
  });

  const onChangeHandler = (val) => {
    setData({
      ...data,
      data: val,
    });
  };

  const onSubmitHandler = () => {
    console.log("works");
  };

  return (
    <div>
      <button
        class="p-2 pl-8 pr-8 text-blue-700 bg-white rounded-md text-lg hover:shadow-inner hover:bg-custom-pink hover:text-white"
        onClick={onSubmitHandler}
      >
        {props.text}
      </button>
    </div>
  );
};

export default GoogleSignIn;
